var datap 

async function getapi(api_url){
    const response = await fetch(api_url)
    var data = await response.json()
    showdata(data)  
}

function showdata(data){
    console.log(data.data)
    datap = data.username
}

getapi(api_url)

function Login() {
    let navigate = useNavigate()


return (

    <div className='body1'>
        <h1 className='header'>Login</h1>
        <br></br>
