        <input type={"text"} placeholder="enter text"></input><br></br><br></br>
        <button onClick={() => navigate('/Credit')}>เข้าสู่ระบบ</button><br></br><br></br>
        <p>{{datap}}</p> 
    </div>
    
);
}

export default Login;
